            _token,
            _entry,
            2
        );


        console.log(matchId);

        KnifeHitMatchData storage matchData = matches[matchId];


        address[] memory playerAddresses = IAsyncGameHub(asyncGameHubAddress).getMatchPlayerAddresses(matchId);

        if (msg.sender == playerAddresses[0]) 
